import React from "react";
import Navbar from "./components/navbar";
import Card from "./components/card";
import "./index.css";
import CardSubcontent from "./components/card-subcontent";

function App() {
  return (
    <div className="App">
      <Header />

      <Navbar />

      <Card>
        <CardSubcontent
          header="About Me"
          textcontent="My name is Sita Robinson. I currently work at Vanguard as a Software
          Developer. I graduated from Drexel University with a BS in Data
          Science and minor in Computer Science in 2020. Some of my hobbies
          include programming, landscape photography, playing the clarinet,
          playing Scrabble and traveling around the world. I am originally a
          Northern Virginia/Metro D.C. native."
        ></CardSubcontent>

        <CardSubcontent
          header="Skills"
          textcontent={
            <div>
              <p>
                Intermediate: Python, HTML/CSS, Javascript, Firebase, Microsoft
                SQL, MySQL, Oracle SQL, MariaDB, Android Studio, Markdown,
                Jupyter Notebook, C++
              </p>

              <p>
                Beginner: R, Node.js, ArcGIS (ArcMap, ArcGIS Online), LaTeX,
                Java, Unix, Tableau, JQuery Mobile, JQuery, Flask, Ruby on
                Rails, ReactJS, Hadoop, Apache Spark, Google Cloud, Angular
              </p>
            </div>
          }
        ></CardSubcontent>
      </Card>
    </div>
  );
}

export default App;
